import React from "react";
import "./Pages.css";
import SkillsData from "../SkillsData";

type SlideProps = {
  numberSlide: number;
  setNumberSlide: (number: number) => void;
};

const WhatIKnowPage: React.FC<SlideProps> = ({
  numberSlide,
  setNumberSlide,
}) => {
  console.log
  return (
    <>
      <div className="slider-container header px-4 w-[100%]">
        <div className="wrapper">
          <h2 className="text-5xl my-8 text-center greeting font-medium ">
            What I Know
          </h2>
          <div className="skills_wrapper">
            <h3>Frontend</h3>
            <div className="grid grid-cols-4 gap-4">
              <div className="skills_card">
                {SkillsData.map((item) =>(
                  <div className="div" key={item.name}>
                    <p>{item.icon}</p>
                    <p>{item.name}</p>
                    <p>{item.group}</p>
                  </div>
                ))}
              </div>
            </div>
          </div>

          <div className="icons">
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(2)}
              >
                <i className="fa-solid fa-arrow-left"></i>&nbsp;My Way in
                Germany
              </button>
            </div>
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(4)}
              >
                My Softskills &nbsp;<i className="fa-solid fa-arrow-right"></i>
              </button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default WhatIKnowPage;
